import React from "react";
import "./Toolbar.css";
import Logo from "../../Logo/Logo";
import NavigationItems from "../NavigationItems/NavigationItems";
import Wallet from "../Wallet/Wallet";
const toolbar = (props) => {
  return (
    <div className="Toolbar">
      <div>
        <Logo />
        <nav>
          <NavigationItems />
        </nav>
      </div>
      <Wallet />
    </div>
  );
};
export default toolbar;
